description:
As Earth is invaded by alien tripod fighting machines, one family fights for survival.

Tom Cruise stars as Ray Ferrier, a divorced dockworker and less-than-perfect father. Soon after his ex-wife and her new husband drop off his teenage son Robbie and young daughter Rachel for a rare weekend visit, a strange and powerful lightning storm touches down. Moments later, at an intersection near his house, Ray witnesses an extraordinary event that will change all their lives forever...

